import { useState, useEffect, React } from "react";

const SolInstEvents = ({ solInst }) => {
  const [solInstsEvents, setSolInstsEvents] = useState([]);

  useEffect(() => {
    const getSolInstsEvents = async () => {
      const solInstsEvents = await fetchSolInstsEvents();
      setSolInstsEvents(solInstsEvents);
    };
    getSolInstsEvents();
  }, []);

  const fetchSolInstsEvents = async () => {
    console.log(solInst.id);
    const response = await fetch(
      "http://localhost:8080/get_EVENTS_by_SOLINST",
      {
        method: "POST",
        body: {
          solInstId: solInst.id,
        },
      }
    );
    const data = await response.json();
    return data;
  };

  return (
    <div>
      {solInstsEvents.map((event) => (
        <h6>{event}</h6>
      ))}
    </div>
  );
};

export default SolInstEvents;
